import { Home, AboutUs, Team, News, Contact, Appointment, Header } from './Container';

import './App.css';
import NewsDetail from './Container/NewsDetail/NewsDetail';

const App = () => (
  <Router>
    <div>
      <Login />
      <Preloader />
      {/* The rest of your components */}
      <Navbar />
      {/* The rest of your components */}
      <Routes>
        {/* The rest of your routes */}
      </Routes>
      <Footer />
    </div>
  </Router>
);

export default App;
